function TableBody(props) {
  return (
    <tbody>
      {props.data.map((i) => (
        <tr key={i.year}>
          <td>{i.year}</td>
          <td>{props.formatter(i.savingsEndOfYear)}</td>
          <td>{props.i.yearlyInterest}</td>
          <td>
            {i.savingsEndOfYear -
              props.initInvestment -
              i.yearlyContribution * i.year}
          </td>
          <td>{props.initInvestment + i.yearlyContribution * i.year}</td>
        </tr>
      ))}
    </tbody>
  );
}

export default TableBody;
